import Proj1 from "../assets/game.PNG";
import Proj2 from "../assets/gyroscope.jpg";
import Proj3 from "../assets/KeyHolder3.png";
import Proj4 from "../assets/CS50xCertificate.png";

export const ProjectList = [
    {
        name: "Game",
        image: Proj1,
        skills: "unity",
        describtion: "I made this game in Unity for the my final project of the Harvard CS50x course. I had experience with Unity in the past but wanted to learn how to make a bot and impliment it in a game. In this game, MistyMaze, the player tries to navigate through the maze to find a golden cube in order to win. However, there are enemies along the way and if you touch them you will lose."
    },
    {
        name: "Gyroscope",
        image: Proj2,
        skills: "Fusion360, 3D Printing",
        describtion: "In high school I was part of the Technology Student Association (TSA). In TSA my group was tasked to complete the challenge of building an RC Car and racing it at the regional and state competitions. There was also a determining factor of carrying marbles in the race that could dock points from our lap score if dropped. To carry the marbles in the specified cup I created a gyroscope that would stay level to the ground as the car took sharp turns with the hope of preventing spillage. I also added a barrier for additional insurance."
    },
    {
        name: "Key Holder",
        image: Proj3,
        skills: "Fusion360, 3D Printing",
        describtion: "Whenever I go on runs outside of my town I find it annoying to carry my car keys in my hands or pocket. This triggered the idea of a flexible keyholder to hold my car keys as well as other types and models for those who may have the same problem when they are running."
    },
    {
        name: "Harvard CS50 Course",
        image: Proj4,
        skills: "Python, jinja, flask, C, HTML, SQLlite, Javascript, CSS",
        describtion: "Harvard and several other schools provide many of there courses online for completely free. I wanted to take advantage of this and learn more about computer science and programming from this course which has been useful in current problem solving."
    },
];
